import React from 'react';
import s from "./Input.module.css";

const Input = (props) => {
  return (
      <div className={s.inputContent}>
        <span className={s.label}>{props.name}</span>
        <input className={`${s.input} ${s.selector}`} type="text"/>
      </div>
  );
};

export default Input;
